export default function ThemeService() {
    
    getAll: async () => {
        try{

        
        const response = await fetch('https://localhost:7172/api/theme/');
        return response.data;
        } catch (err) {
            throw alert("Error while fetching themes: " + err.message);
        }
    }
    
}
